import React, { useState, useEffect, useCallback } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { Bar, Line, Pie } from "react-chartjs-2";
import {
Chart as ChartJS,
CategoryScale,
LinearScale,
BarElement,
LineElement,
PointElement,
ArcElement,
Tooltip,
Legend,
} from "chart.js";

ChartJS.register(
CategoryScale,
LinearScale,
BarElement,
LineElement,
PointElement,
ArcElement,
Tooltip,
Legend
);

function Dashboard({ devices = [], fetchData }) {
const [visibleDevices, setVisibleDevices] = useState(
devices.reduce((acc, d) => ({ ...acc, [d.DEVICE_ID]: true }), {})
);
const [timeRange, setTimeRange] = useState("day");
const [customRange, setCustomRange] = useState([null, null]);
const [startDate, endDate] = customRange;
const [filteredDevices, setFilteredDevices] = useState(devices);
const [refreshInterval, setRefreshInterval] = useState(10000);

const handleToggleDevice = (id) =>
setVisibleDevices((prev) => ({ ...prev, [id]: !prev[id] }));

const handleTimeChange = (e) => setTimeRange(e.target.value);
const handleRefreshChange = (e) => setRefreshInterval(Number(e.target.value));

const filterDevices = useCallback(
(allDevices) => {
const now = new Date();
return allDevices.filter((d) => {
if (!visibleDevices[d.DEVICE_ID]) return false;
const deviceDate = new Date(d.timestamp || now);
if (timeRange === "day") return deviceDate.toDateString() === now.toDateString();
if (timeRange === "week") {
const weekStart = new Date(now);
weekStart.setDate(now.getDate() - now.getDay());
return deviceDate >= weekStart && deviceDate <= now;
}
if (timeRange === "month") {
return (
deviceDate.getMonth() === now.getMonth() &&
deviceDate.getFullYear() === now.getFullYear()
);
}
if (timeRange === "custom" && startDate && endDate) {
const start = new Date(startDate);
const end = new Date(endDate);
end.setHours(23, 59, 59, 999);
return deviceDate >= start && deviceDate <= end;
}
return true;
});
},
[visibleDevices, timeRange, startDate, endDate]
);

useEffect(() => setFilteredDevices(filterDevices(devices)), [devices, filterDevices]);
useEffect(() => {
if (!fetchData) return;
const interval = setInterval(async () => {
const newDevices = await fetchData();
setFilteredDevices(filterDevices(newDevices));
}, refreshInterval);
return () => clearInterval(interval);
}, [fetchData, filterDevices, refreshInterval]);

// --- Charts & total kWh same as before ---

return (
<div style={{ padding: 16 }}>
<div style={{ display: "flex", gap: 16, flexWrap: "wrap", marginBottom: 12 }}> <div> <label>Time Range:</label>
<select value={timeRange} onChange={handleTimeChange} style={{ marginLeft: 8, padding: "4px 8px" }}> <option value="day">Hôm nay</option> <option value="week">Tuần này</option> <option value="month">Tháng này</option> <option value="custom">Tùy chỉnh</option> </select> </div>

`
    {timeRange === "custom" && (
      <div style={{ display: "flex", alignItems: "center", gap: 8 }}>
        <DatePicker
          selectsRange
          startDate={startDate}
          endDate={endDate}
          onChange={(update) => setCustomRange(update)}
          isClearable
          placeholderText="Chọn khoảng ngày"
        />
      </div>
    )}

    <div>
      <label>Refresh:</label>
      <select value={refreshInterval} onChange={handleRefreshChange} style={{ marginLeft: 8, padding: "4px 8px" }}>
        {/* REFRESH_OPTIONS as before */}
      </select>
    </div>
  </div>
</div>


);
}

export default Dashboard;
